import React from 'react';
import ReactDOM from 'react-dom';

function MyApp() {
    return <ul>
        <li>Ye</li>
        <li>No</li>
        <li>Maybe</li>
    </ul>
}

ReactDOM.render(MyApp(), document.getElementById("root"));
